import React, { Component } from 'react';

export default class One extends Component {
    state = {
        list: [],
    };
    render() {
        return (
            <div>
                <ul>
                    <li>
                        <span>姓名</span>
                        <span>密码</span>
                        <span>状态</span>
                    </li>
                </ul>
            </div>
        );
    }
    async componentDidMount() {
        let res = await this.http('/getlist');
        this.setState({
            list: res.data.result,
        });
        console.log(this.state.list);
    }
}
